import React, { Component } from 'react';
import axios from "axios"
import { Button } from 'react-bootstrap';

class ShowUsers extends Component {
    state = {
        users: []
      }
    getUsers = () => {
        axios.get("/getUsersInfo").then(response => console.log(response))
    }

    printUsers = (response) => {
        return response.data.map(e => <div>
            <h1>{e.username}</h1>
            {e.ratings.map(movie => <p>{movie}</p>)}
        </div>)
    }
    render() { 
        return <React.Fragment>
            {this.state.users.map(e => <h1>{e}</h1>)}
            <Button onClick={() => this.getUsers()}>
            JAZDA
            </Button>
            {this.printUsers()}
        </React.Fragment>
    }
}

export default ShowUsers;
